import React, { Component } from "react";
import NavBar from "../components/navbar";
import PhotoFeed from "../components/PhotoFeed";

class MyFeed extends Component {
    render() {
        return(
            <div>
                <p>{this.props.name}</p>
                <header>
                    <NavBar {...this.props}/>
                </header>
                <PhotoFeed {...this.props}/>
            </div>
        )
    }
}

export default MyFeed;
